import './App.css';

class Character {
  constructor(class_, spec, race) {
    this.class_ = class_;
    this.spec = spec;
    this.race = race;

  }
}

const Person = (props) => {
  return (
    <>
      <h1>Class: {props.class}</h1>
      <h2>Spec: {props.spec}</h2>
      <h3>Race: {props.race}</h3>
    </>
  )
}

const App = () => {
  return (
    <div className="App">
      <h1>
        <Person class="Priest" spec="Holy" race="Undead"/>
        <Person class="Demon Hunter" spec="Vengence" race="Blood Elf"/>
      </h1>
    </div>
  );
}

export default App;
